import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-f940f4d08973e",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/yonekurayuuki/github/tcsympo2019/README.md").then(comp => {
        Vue.component("v-f940f4d08973e", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-05339ad46f18c",
    path: "/about/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/yonekurayuuki/github/tcsympo2019/about/README.md").then(comp => {
        Vue.component("v-05339ad46f18c", comp.default)
        next()
      })
    }
  },
  {
    path: "/about/index.html",
    redirect: "/about/"
  },
  {
    name: "v-b50832572d119",
    path: "/about/page-1.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/yonekurayuuki/github/tcsympo2019/about/page-1.md").then(comp => {
        Vue.component("v-b50832572d119", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
